        public enum eDictionary { Reinhold, EFF, Weber };
        public static Random getrandom = new Random();
        public static List<string> GetAmountOfWords(int amount, eDictionary dictionary)
        {
            List<string> returnWords = new List<string>();
            List<string> allWords = words(dictionary);
            for (int i = 0; i < amount; i++)
            {
                returnWords.Add(allWords[GetRandomNumber(0,allWords.Count)]);
            }
            return returnWords;
        }
        public static List<string> words(eDictionary dictionary)
        {
            List<string> words = new List<string>();
            string s = string.Empty;
            switch (dictionary)
            {
                case eDictionary.Reinhold:
                    s = Reinhold();
                    break;
                case eDictionary.EFF:
                    s = EFF();
                    break;
                case eDictionary.Weber:
                    s = Weber(); 
                    break;
                default:
                    break;
            }
            foreach (string sString in s.Split(','))
            {
                words.Add(sString);
            }
            return words;
        }
        public static char RandomSymbol()
        {
            string Symbols = "!£$%&?/@+=#";
            Random rand = new Random();
            int num = rand.Next(0, Symbols.Length - 1);
            return Symbols[num];
        }
        public static char RandomNumber()
        {
            //removed 'confusing' characters
            string Nums = "23456789";
            Random rand = new Random();
            int num = rand.Next(0, Nums.Length - 1);
            return Nums[num];
        }
        public static int GetRandomNumber(int min, int max)
        {
            return getrandom.Next(min, max);
        }
        public static char RandomChar()
        {
            //removed 'confusing' characters
            string Chars = "aAbBcCdDeEfFgGhHJkKLmMnNpPqQrRsStTuUvVxXyYzZ";
            Random rand = new Random();
            int num = rand.Next(0, Chars.Length - 1);
            return Chars[num];
        }
        public static int GetDictionaryCount(eDictionary dictionary)
        {
            List<string> wordsList = words(dictionary);
            int i = wordsList.Count;
            return i;
        }
        public static string FirstCharToUpper(string value)
        {
            char[] array = value.ToCharArray();
            // Handle the first letter in the string.  
            if (array.Length >= 1)
            {
                if (char.IsLower(array[0]))
                {
                    array[0] = char.ToUpper(array[0]);
                }
            }
            // Scan through the letters, checking for spaces.  
            // ... Uppercase the lowercase letters following spaces.  
            for (int i = 1; i < array.Length; i++)
            {
                if (array[i - 1] == ' ')
                {
                    if (char.IsLower(array[i]))
                    {
                        array[i] = char.ToUpper(array[i]);
                    }
                }
            }
            return new string(array);
        }
